import Navbar from "./components/Navbar/index";
import {BrowserRouter as Router, Route} from 'react-router-dom';
import "./App.css";
import Home from "./pages";

function App() {
  return (
    <Router>
      <Navbar />

        <Route path='/' exact Component={Home} />
    </Router>
  );
}

export default App;
